export class AllBoards extends Component {

    constructor (props){
        super(props)
        this.state = {boards :[] }
    }
	componentDidMount = () => {
		fetch(
			"https://api.trello.com/1/members/me/boards?fields=name,url&key=a32c5c0c541016f7fd5c81bc1e4e47ef&token=a4711b0c6df1e11c11b241284521cf44441681fb61c66088f45fae8a9a4501f6",
			{
				method: "GET",
			}
		)
			.then((response) => {
				return response.json();
			})
			.then((data) => console.log(data))
			.catch((err) => console.error(err));
	};

	render() {
		return (
			<div className=" col-span-3 bg-red-500 flex items-start my-10 ">
				<div className="bg-yellow-500 p-3 w-1/5 mx-1 h-20 mx-4 my-4 text-white font-bold">
					hacker rank
				</div>
			</div>
		);
	}
}

export default AllBoards;
